<template>
  <q-layout
      view="lHh Lpr lFf"
  >
    <q-page-container>
      <FLoadingScreen v-if="AppIsLoading"/>
      <AppPage v-else />
    </q-page-container>
  </q-layout>
</template>

<script lang="ts" setup>
  import type {IUIActions} from "@/classes/UI/Interfaces/IUIActions";
  import {useQuasar} from "quasar";
  import {computed, inject, onMounted, ref, watch} from "vue";
  import {storeToRefs} from "pinia";
  import {UIStore} from "@/classes/Pinia/UIStore/UIStore";
  import FLoadingScreen from "@/components/common/FLoadingScreen.vue";
  import type {TranslateFunction} from "@/lang/TranslateFunction";
  import {useI18n} from "vue-i18n";
  import AppPage from "@/components/AppPage.vue";
  import {useRouter} from "vue-router";
  import bridge from "@vkontakte/vk-bridge";
  import i18n from "@/classes/install/i18n";
  import enLang from 'quasar/lang/en-US.js';
  import ruLang from 'quasar/lang/ru.js';
  import {IEventActions} from "@/classes/UI/Interfaces/IEventActions";

  const $q = useQuasar();
  $q.dark.set('auto');
  const router = useRouter();
  const UI = inject<IUIActions>('UI');
  const TARGET_EVENTS = inject<IEventActions>('TARGET_EVENTS');

  const {t} = useI18n() as {t:TranslateFunction};

  const {
      isReady,
      launchError,
      userQueryError,
      user,
      isLoading,
      launchParams
  } = storeToRefs(UIStore())

  const AppIsLoading = computed(() => {
    return !isReady.value;
  });

  watch(isLoading, (neoVal) => {
    if(neoVal){
      $q.loading.show({
        delay: 500
      });
    }
    else{
      $q.loading.hide();
    }
  });

  watch((launchError), (neoVal) => {
    if(neoVal){
      $q.dialog({
        title: t('Launch.error'),
        message: t('Launch.errorLaunch'),
        html: true,
        persistent: true,
        ok: false
      });
    }
  });
  watch((userQueryError), (neoVal) => {
    if(neoVal){
      $q.dialog({
        title: t('Launch.error'),
        message: t('Launch.errorGetUser'),
        html: true,
        persistent: true,
        ok: false
      });
    }
  });

  watch(isReady, (neoVal) => {
    if(neoVal){
      if(user.value.isNew){
        UI?.showWelcomeSlides({
          slides: [
            {
              media: {
                blob: 'data:image/png;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.1.title'),
              subtitle: t('Launch.welcomeSlides.1.subtitle'),
            },
            {
              media: {
                blob: 'data:image/png;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.2.title'),
              subtitle: t('Launch.welcomeSlides.2.subtitle'),
            },
            {
              media: {
                blob: 'data:image/png;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.3.title'),
              subtitle: t('Launch.welcomeSlides.3.subtitle'),
            },
            {
              media: {
                blob: 'data:image/png;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.4.title'),
              subtitle: t('Launch.welcomeSlides.4.subtitle'),
            },
            {
              media: {
                blob: 'data:image/jpeg;base64,',
                type: 'image',
              },
              title: t('Launch.welcomeSlides.5.title'),
              subtitle: t('Launch.welcomeSlides.5.subtitle'),
            },


          ]
        });
        TARGET_EVENTS?.sendEvent('registration');
      }
      else{
        TARGET_EVENTS?.sendEvent('login');
      }
      let neoLang: "ru" | "en" = 'ru';
      if(launchParams?.value?.vk_language){
        const launchLang = launchParams?.value?.vk_language;
        if(
            launchLang == 'en' ||
            launchLang == 'be' ||
            launchLang == 'pt' ||
            launchLang == 'es'
        ){
          neoLang = 'en';
        }
      }
      if(i18n.global.locale.value && i18n.global.locale.value != neoLang){
        i18n.global.locale.value = neoLang;
        if(neoLang == 'ru'){
          $q.lang.set(ruLang);
        }
        if(neoLang == 'en'){
          $q.lang.set(enLang);
        }
      }
    }
  });

  onMounted(() => {
      if(launchError.value){
        $q.dialog({
          title: t('Launch.error'),
          message: t('Launch.errorLaunch'),
          html: true,
          persistent: true,
          ok: false
        });
      }
      if(userQueryError.value){
        $q.dialog({
          title: t('Launch.error'),
          message: t('Launch.errorGetUser'),
          html: true,
          persistent: true,
          ok: false
        });
      }

    bridge.subscribe((e) => {
      if (e.detail.type === 'VKWebAppUpdateConfig') {
        if(e.detail.data.appearance == 'light'){
          $q.dark.set(false);
        }
        else if(e.detail.data.appearance == 'dark'){
          $q.dark.set(true);
        }

      }
    });

  });


</script>
